import { AppBar } from '@material-ui/core';
import "./PayrollAppBar.css"

import React, { Component } from 'react'

export default class PayrollAppBar extends Component {
  render() {
    return (
      <div>
        <Card className='form'>
      <AppBar  EMPLOYEE PAYROLL>

          <div className='Apptitle'>
            EMPLOYEE 
          </div>
          <div className='Apptitle'>
            PAYROLL</div>

      </AppBar>
      </Card>
      </div>
    )
  }
}
